import { configureStore } from "@reduxjs/toolkit";

import popupReducer from "./popup/reducer";
import userReducer from "./user/reducer";

const store = configureStore({
  reducer: {
    popup: popupReducer,
    user: userReducer,
  },
});

export default store;
